svg.script:
var transMatrix = [1, 0, 0, 1, 0, 0];
function clickChild(evt){window.parent.clickChild(evt);}
function init(evt) {
if (window.svgDocument == null) {
svgDoc = evt.target.ownerDocument;
}
mapMatrix = svgDoc.getElementById("map-matrix");
clientWidth = svgDoc.documentElement.clientWidth;
clientHeight = svgDoc.documentElement.clientHeight;
getlayer(svgDoc);
addEvent(mapMatrix);
width = mapMatrix.firstElementChild.width.animVal.value;
height = mapMatrix.firstElementChild.height.animVal.value;
transMatrix[0] = 1;
transMatrix[3] = 1;
transMatrix[4] = -(width/2)+(clientWidth/2);
transMatrix[5] = -(height/2)+(clientHeight/2);
newMatrix = "matrix(" + transMatrix.join(' ') + ")";
mapMatrix.setAttributeNS(null, "transform", newMatrix);
zoomIn(clientHeight/height);
}
function addEvent(mapMatrix) {
if(document.addEventListener){
mapMatrix.addEventListener('DOMMouseScroll',mousewheel,false);}
mapMatrix.setAttribute("onmousewheel", "mousewheel(evt)");
mapMatrix.setAttribute("onmouseup", "mouseup(evt)");
mapMatrix.setAttribute("onmousedown", "mousedown(evt)");
mapMatrix.setAttribute("onmousemove","mousemove(evt)");
mapMatrix.setAttribute("onmousemout", "mousemout(evt)");
}
function mousewheel(evt) {
if (evt.wheelDelta) {
console.log(evt.wheelDelta);
if (evt.wheelDelta == 120) {
zoomOut(1.25);
}else if(evt.wheelDelta == 180){
zoomOut(1.25);
} else {
zoomIn(0.8);
}
} else if (evt.detail) {
if (evt.detail == -3) {
zoomOut(1.25);
} else {
zoomIn(0.8);}}}
var downx = 0;var downy = 0;var downclick = 0;var movex = transMatrix[4];var movey = transMatrix[5];
function mouseup(evt) {
var oEvent = evt || event;
var x = (oEvent.clientX - downx);
var y = (oEvent.clientY - downy);
movex += x;
movey += y;
downclick = 0;downx = 0;downy = 0;}
function mousemout(evt) {
downclick = 0;downx = 0;downy = 0;}
function mousedown(evt) {
var oEvent = evt || event;
downclick = 1;
downx = oEvent.clientX;
downy = oEvent.clientY;}
function mousemove(evt) {
if (downclick == 1) {
var oEvent = evt || event;
var x = (oEvent.clientX - downx);
var y = (oEvent.clientY - downy);
transMatrix[4] = x + movex;
transMatrix[5] = y + movey;
newMatrix = "matrix(" + transMatrix.join(' ') +")";
mapMatrix.setAttributeNS(null,"transform", newMatrix);}}
function getlayer(SvgMainMapDoc) {
var node = SvgMainMapDoc.documentElement;
findnode(node)}
function findnode(node) {
for (var i = 0; i < node.childNodes.length; i++) {
if (node.childNodes.item(i).nodeType != 3 && node.childNodes.item(i).nodeType != 4) {
var child = node.childNodes.item(i);
if (child.getAttribute("id") && child.getAttribute("objid") != "" && child.getAttribute("objid") != null) {
/*child.setAttribute("onclick", "click(this)"); */}
if (child.childNodes) {
findnode(child);
} else {
break;
}}}}
function click(evt) {
/*alert(evt.getAttribute("objid") + "_" + evt.getAttribute("objtype")+"_"+evt.getAttribute("name")); */}
function move(evt){
var id = evt.getAttribute("objtype") + "_" + evt.getAttribute("objid")
var node = svgDoc.documentElement;
opacity(node,"1",id);}
function out(evt){
var id = evt.getAttribute("objtype") + "_" + evt.getAttribute("objid")
var node = svgDoc.documentElement;
opacity(node,"0",id); }
function opacity(node,value,id){
for (var i = 0; i < node.childNodes.length; i++) {
if (node.childNodes.item(i).nodeType != 3 && node.childNodes.item(i).nodeType != 4) {
var child = node.childNodes.item(i);
if (child.getAttribute("opacity") && child.getAttribute("geoLabel") != null &&child.getAttribute("geoLabel") == id ) {
child.setAttribute("opacity", value);}
if (child.childNodes) {
opacity(child,value,id);
} else {
break;}}}}
function pan(dx, dy) {
transMatrix[4] += dx;
transMatrix[5] += dy;
newMatrix = "matrix(" + transMatrix.join('') + ")";
mapMatrix.setAttributeNS(null, "transform", newMatrix);}
function zoomIn(scale) {
console.log(scale);
if(transMatrix[0] < 0.02 )
return;
for (var i = 0; i < transMatrix.length; i++) {
transMatrix[i] *= scale;}
transMatrix[4] += (1 - scale) * clientWidth / 2;
transMatrix[5] += (1 - scale) * clientHeight / 2;
movex = transMatrix[4];
movey = transMatrix[5];
newMatrix = "matrix(" + transMatrix.join(' ') + ")";
mapMatrix.setAttributeNS(null, "transform", newMatrix);}
function zoomOut(scale) {
console.log(scale);
if(transMatrix[0]>10 ) 
return;
for (var i = 0; i < transMatrix.length; i++) {
transMatrix[i] *= scale;}
transMatrix[4] += (1 - scale) * clientWidth / 2;
transMatrix[5] += (1 - scale) * clientHeight / 2;
movex = transMatrix[4];
movey = transMatrix[5];
newMatrix = "matrix(" + transMatrix.join(' ') + ")";
mapMatrix.setAttributeNS(null, "transform", newMatrix);}
